import "./Cart.css";
import CheckOut from "./CheckOut";

const CartButton = (props) => {
  const addToCartHandler = () => {
    console.log("clicked");
    console.log(props.data);
  };
  return (
    <div class="button">
      <button class="add_to_cart" onClick={addToCartHandler}>
        Add to Cart
      </button>
    </div>
  );
};

export default CartButton;
